import React, { useState } from "react";
import './styles/Header.css'

const Header = function(){
    return(
        <header>
            <ul>
                <li><a>GameSpace</a></li>
                <li><a>Shop</a></li>
                <li><a>Library</a></li>
                <li><a>Report</a></li>
            </ul>
        </header>
    );
}

export default Header;
